INSERT INTO products (id,name,quantity,price,description,category_id) VALUES (212,'Opton',75,4500,'Gracias a su altura constructiva sumamente reducida y a su elevada potencia luminosa, Opton es ideal para escaparates o locales de venta.\r\nEl cabezal de fundiciÃ³n de aluminio garantiza una larga duraciÃ³n gracias a su gestiÃ³n tÃ©rmica perfeccionada.\r\nEn combinaciÃ³n con una luminotecnia eficiente, Opton ofrece unas condiciones ideales en cuanto a eficiencia energÃ©tica, y alcanza un grado mÃ¡ximo de rentabilidad.',5);
