INSERT INTO products (id,name,quantity,price,description,category_id) VALUES (215,'Oseris',30,6500,'Con Oseris hace su entrada en el mundo de la iluminaciÃ³n digital una genial idea de diseÃ±o: la articulaciÃ³n giratoria, que se integra perfectamente como secciÃ³n oblicua en el cabezal hemisfÃ©rico. Una soluciÃ³n que no solo es estÃ©ticamente atractiva, sino que ademÃ¡s permite una orientaciÃ³n sumamente precisa y ofrece un valor aÃ±adido en situaciones con poca libertad de movimiento, por ejemplo en canales de techo.',5);
INSERT INTO products (id,name,quantity,price,description,category_id) VALUES (216,'Pollux',65,5000,'Pollux fue desarrollado para el uso versÃ¡til. Gracias a su formato compacto, despliega sus virtudes especialmente en museos, en el comercio minorista, en la restauraciÃ³n o en el entorno domÃ©stico privado.',5);
INSERT INTO products (id,name,quantity,price,description,category_id) VALUES (217,'Stella',10,15000,'Herramientas potentes, eficientes y precisas para la iluminaciÃ³n de acento\r\nEs una ley fÃ­sica: la iluminancia disminuye de forma proporcional al cuadrado de la distancia entre la fuente de luz y la superficie iluminada. Por tanto, se necesitan luminarias potentes para grandes distancias de iluminaciÃ³n y espacios con techos altos: por ejemplo, para la escenificaciÃ³n de vehÃ­culos en un pabellÃ³n ferial, para grandes esculturas en el vestÃ­bulo de un museo o para el baÃ±ado de paredes uniforme en un aeropuerto',5);
