INSERT INTO products (id,name,quantity,price,description,category_id) VALUES (219,'Jilly para riel',25,5000,'IluminaciÃ³n de puestos de trabajo de oficina altamente eficiente y conforme a la normativa, con el raÃ­l electrificado como base flexible.\r\nLas luminarias Jilly para raÃ­les electrificados se encargan de la iluminaciÃ³n eficiente de puestos de trabajo conforme a la normativa y son idÃ³neas para el entorno laboral moderno y dinÃ¡mico, en el que las distribuciones de oficinas cambian y se reorganizan continuamente. El cuerpo especialmente plano y una llamativa rejilla de lamas marcan su elegante estÃ©tica ',5);
INSERT INTO products (id,name,quantity,price,description,category_id) VALUES (220,'Compar para Riel',30,4500,'La combinaciÃ³n de raÃ­les electrificados como infraestructura y luminarias Compar permite iluminar la arquitectura de oficinas y los puestos de trabajo de manera diferenciada, ergonÃ³mica y al mismo tiempo extremadamente flexible. Se utiliza la luminotecnia de la amplia familia Compar tambiÃ©n en su versiÃ³n de downlights para railes electrificados. Con su cuerpo plano, tambiÃ©n estÃ¡n indicados para espacios con una escasa altura del techo',5);
INSERT INTO products (id,name,quantity,price,description,category_id) VALUES (221,'Palco ',40,3000,'Luminaria de interiores orientable y con adaptador para instalaciÃ³n sobre raÃ­l de tensiÃ³n de red.\r\nLuminaria realizada en aluminio fundido a presiÃ³n.\r\nLa doble orientabilidad de la luminaria permite una rotaciÃ³n de 360Â° alrededor del eje vertical y una inclinaciÃ³n de 90Â° respecto al plano horizontal.\r\nBloqueos mecÃ¡nicos del direccionamiento tanto para la rotaciÃ³n alrededor del eje vertical como respecto al plano horizontal.',5);
INSERT INTO products (id,name,quantity,price,description,category_id) VALUES (222,'Le Perroquet',70,12000,'Cuerpo Ã³ptico en aluminio fundiciÃ³n a presiÃ³n y material termoplÃ¡stico. Elevado confort visual.',5);
