INSERT INTO products (id,name,quantity,price,description,category_id) VALUES (224,'Site BaÃ±ador',20,20000,'BaÃ±adores de pared de luz rasante para acentuar texturas\r\nen muros y fachadas Site acentÃºa la textura de los materiales de la arquitectura: el baÃ±ador de pared de luz tenue hace claramente visibles incluso las texturas mÃ¡s sutiles de la madera, el hormigÃ³n o los ladrillos y de superficies rugosas como piedra natural, lo que hace posible la acentuaciÃ³n\r\nexpresiva de elementos histÃ³ricos o materiales regionales.',8);
INSERT INTO products (id,name,quantity,price,description,category_id) VALUES (225,'Tesis Cuadrado',20,18000,'Un arquetipo innovador en la iluminaciÃ³n de espacios exteriores Tesis, desde hace tiempo un elemento integral del programa de exteriores, ha alcanzado un nuevo nivel de rendimiento fruto de un desarrollo intensivo. La luminotecnia convence con un grado mÃ¡ximo de brillo y eficiencia. Ya sea en la variante redonda o cuadrada, el nuevo diseÃ±o del cuerpo, sensiblemente mÃ¡s plano gracias a la tecnologÃ­a LED, posibilita un montaje sumamente cÃ³modo ',8);
INSERT INTO products (id,name,quantity,price,description,category_id) VALUES (226,'Midipoll baliza',25,10000,'La suave luz rasante sobre el marcado perfil en forma de cruz convierte a Midipoll en un elemento estructurador del espacio Con Midipoll se presenta una baliza que responde al concepto del confort visual eficiente. La innovadora luminotecnia con una lente prismÃ¡tica especial proyecta eficazmente el flujo luminoso sobre la superficie de destino, sin deslumbramiento, para cumplir los requisitos Dark Sky. De este modo, el cielo nocturno permanece oscuro y las estrellas visibles.',8);
